import React from "react";
import classes from "./Categories.module.scss";
const Categories = () => {
  return (
    <div className={classes.categories}>
      <ul>
        <li>Breakfast</li>
        <li>Lunch</li>
        <li>Dinner</li>
        <li>Appetizers</li>
        <li>Desserts</li>
      </ul>
    </div>
  );
};

export default Categories;
